import React from "react";
import "./Topnav.css";
import logo from "../images/logo.png";
import CallIcon from "@material-ui/icons/Call";
import WhatsAppIcon from "@material-ui/icons/WhatsApp";
import EmailIcon from "@material-ui/icons/Email";
import TwitterIcon from "@material-ui/icons/Twitter";
import InstagramIcon from "@material-ui/icons/Instagram";


function Topnav() {
  return (
    <div className='topnav border-bottom shadow-sm'>
      <div className='container'>
        <div className='row align-items-center pt-2'>

          <nav className='topnav__logo navbar p-0 ml-4'>
            <a className='navbar-brand m-0' href='/'>
              <img
                className='d-inline-block align-top'
                src={logo}
                alt='Passaggregate logo'
              />
            </a>
          </nav>

          <div className='topnav__enquiries d-flex flex-row align-items-center mx-auto border-left border-right shad'>
            <a color='secondary' href='tel:+2348062820377'>
              <CallIcon style={{ fontSize: 18 }} />
            </a>

            <a color='secondary' href='/'>
              <WhatsAppIcon style={{ fontSize: 18 }} />
            </a>

            <a color='secondary' href='/'>
              <EmailIcon style={{ fontSize: 18 }} />
            </a>

            <a color='secondary' href='/'>
              <TwitterIcon style={{ fontSize: 18 }} />
            </a>

            <a color='secondary' href='/'>
              <InstagramIcon style={{ fontSize: 18 }} />
            </a>
          </div>

          <div className='topnav__auth mr-4'>
            <a color='secondary' href='/'>
              <InstagramIcon style={{ fontSize: 18 }} />
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Topnav;
